import React from "react";
import './Todo.css';
import Button from "../components/Button";


const Todo = (props) =>{

    const clickRemoveTodo = () =>{
        props.clickRemoveTodo(props.id);
    }

    return (
       
            <li className="todo_item">
                <div className="todo_wrapper">
            <input type="checbox" />
            <p>{props.todo.text}</p>
            </div>
            <Button text ="Удалить Todo" click={clickRemoveTodo}/>
        </li>
    )}
     
    


export default Todo;
